import styled from '@emotion/styled'

const Ul = styled.ul`
  position: fixed;
  width: 210px;
  left: 0px;
  top: 0px;
  background: #FFFFFF;
`

const A = styled.a`
    display: block;
`


const Sidebar = () => (
    <div>
        <Ul>
            <A href="#">Занятия</A>
            <A href="#">Учащиеся</A>
            <A href="#">Тренеры</A>
            <A href="#">Финансы</A>
            <A href="#">Абонементы</A>
            <A href="#">Доступ в CRM</A>
            <A href="#">Рассылки</A>
            <A href="#">Отчеты</A>
            <A href="#">Настройки</A>
        </Ul>
    </div>
)

export default Sidebar;
